  namespace: NDSH.Geospatial.Common.BasicTypes.Primitive.Multiplicities
  summary: >-
    Gets or sets the <xref href="System.Collections.ObjectModel.ObservableCollection%601" data-throw-if-not-resolved="false"></xref>

    instances defining the allowed occurrences.
  remarks: >-
    Each entry in this collection represents a <b>valid cardinality range</b>.

    <ul><li>
        The <b>lower bound</b> of a range specifies the minimum number of times an element must occur.
      </li><li>
        The <b>upper bound</b> specifies the maximum number of times an element may occur.
      </li><li>
        An <b>unbounded upper limit</b> (âˆž) is represented by
        <xref href="NDSH.Geospatial.Common.BasicTypes.Primitive.Numerics.UnlimitedIntegerDbEntity" data-throw-if-not-resolved="false"></xref> with <code>IsInfinite = true</code> and <code>Value = null</code>.
      </li></ul>
  example:
  - >-
    To define a <b>required single occurrence</b> (<code>1..1</code>):

    <pre><code class="lang-csharp">multiplicity.Range.Add(new MultiplicityRange_Type { Lower = 1, Upper = new UnlimitedIntegerDbEntity(1) });</code></pre>
